import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const handleDelete = () => {
    fetch('https://example.com/api/some-resource', {
      method: 'DELETE',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(response => response.json())
      .then(data => {
        setMessage('Resource deleted successfully!');
      })
      .catch(error => {
        setMessage('An error occurred while deleting the resource.');
      });
  };


  return (
    <nav>
      <div className="nav-left">
        <Link className='brand' to="/">MovieAwards</Link>
      </div>
      <div className="nav-middle">
        <Link className='menu' to="/">Home</Link>
        <Link className='menu' to="/about">About</Link>
        <Link className='menu' to="/myvotes">Your Votes</Link>
      </div>
      <div className="nav-right">
        <Link className='menu' to="/login">Login</Link>
        <p>|</p>
        <div className='menu'onClick={handleDelete}>Logout</div>
      </div>
    </nav>
  );
}

export default Navbar;
